import React from "react";

function Navigation() {
  return (
    <div className="space-x-8 transition ease-in-out delay-150 cursor-pointer hover:-translate-y-1 hover:scale-110 hover:bg-slate-300 duration-300">
      <span className="cursor-pointer">Home</span>
      <span className="cursor-pointer">Best Seller</span>
      <span className="cursor-pointer">Category</span>
      <span className="cursor-pointer">Community</span>
      <span className="cursor-pointer">Blog</span>
    </div>
  );
}

export default Navigation;
